import React, { ReactChild, ReactNode } from 'react';

interface CardProps {
    width?: string
    height?: string
    children?: ReactNode | ReactChild
}

const Card = ({ width,height, children }: CardProps) => {
    return (
        <div style={{ width, height, background: "grey" }}>
            { children }
        </div>
    );
};

export default Card;
